(function(window, document, $){
	window.app={};
	var app=window.app;
	app.lib={};
	// Ajax
	app.lib.ajax=function(param, callback){
		param.type || "GET";
		param.type=param.type.toUpperCase();
		param.contentType || "application/json";
		param.complete = function(rs){
			var response={};
			switch(rs.status){
				case 200:
					response.status=true;
					response.value=rs.responseJSON;
					break;
				case 500:
					response.status=false;
					response.errorCode="system.error";
					response.value=rs.responseText;
					break;
				case 401:
					response.status=false;
					response.errorCode="login.not.session";
					break;
				case 400:
					response.status=false;
					response.errorCode="system.error";
					response.value="Request Error!";
					break;
				case 404:
					response.status=false;
					response.errorCode="system.error";
					response.value="Function Not Available!";
					break;
				default:
					console.log(rs);
					break;
			}
			callback(response)
		}
		$.ajax(param);
	};
	// Properties	
	$.i18n.browserLang=function(){ return ""; };
	$.i18n.properties({ 
		name: "messages", 
		path: "resources/", 
		mode: "map",
		lang: "en",
		cache: !0,
		callback: function() { 
		},
		error: function(){
		}
	});
	app.lib.prop=function(key){
		return $.i18n.prop(key);
	}
	// Pop Alert
	app.lib.alert=function(type, message, callback){
		$(".app-alert").remove();
		var icon="glyphicon-question-sign";
		switch(type){
			case "success":
				icon="glyphicon-ok-sign success";
				break;
			case "error":
				icon="glyphicon-remove-sign error";
				break;
			case "info":
				icon="glyphicon-info-sign info";
				break;
		}
		var _html="<div class='app-alert app-overlay'></div>";
		_html+="<div class='app-alert app-alert-container "+type+"'>";
		_html+="<div class='app-alert app-alert-wrapper'>";
		_html+="<div class='app-alert-title'>"+app.lib.prop("alert_"+type)+"</div>";
		_html+="<div class='app-alert-content'>";
		_html+="<span class='glyphicon "+icon+" app-alert-icon'></span>";
		_html+="<p class='app-alert-text'>"+app.lib.prop(message)+"</p>";
		_html+="</div>";
		_html+="<div class='app-alert-btn'><input type='button' id='alert_ok' class='app-alert-btn-ok' value='"+app.lib.prop("alert_ok")+"' /></div>";
		_html+="</div>";
		_html+="</div>";
		$("body").append(_html);
		// Click OK
		$("#alert_ok").unbind("click").bind("click", function(){
			$(".app-alert").remove();
			if(callback) callback();
		});
	}
	// Pop Window
	app.lib.popup=function(prop, callback){
		$(".app-popup").remove();
		prop.text || "";
		var width=prop.width ? "width: "+prop.width+";" : "";
		var height=prop.height ? "height: "+prop.height+";" : "";
		var style=width+height;
		var _html="<div class='app-popup app-overlay'></div>";
		_html+="<div class='app-popup app-popup-container'>";
		_html+="<div class='app-popup app-popup-wrapper' style='"+style+"'>";
		_html+="<a href='javascript:void(0);' class='app-popup-close glyphicon glyphicon-remove-circle'></a>";
		_html+="<div class='app-popup-content'>"+prop.text+"</div>";
		_html+="</div>";
		_html+="</div>";	
		$("body").append(_html);
		// Close
		$(".app-popup-close").unbind("click").bind("click", function(){
			$(".app-popup").remove();
			if(callback) callback();
		});
	}
	// Loader Show/Hide
	app.lib.loader=function(type, targetId){
		// Hide
		if(type=="hide"){
			$(".app-loader").remove();
			return;
		}
		// Show
		if(type=="show"){
			var position=targetId ? "absolute" : "fixed";
			var _html="<div class='app-loader app-overlay' style='position: "+position+"'></div>";
			_html+="<div class='app-loader app-popup-container' style='position: "+position+"'>";
			_html+="<img class='app-loader-icon' src='data:image/gif;base64,' />";
			_html+="</div>";	
			$(targetId || "body").append(_html).css({ position: "relative" });
			return;
		}
	}
	window.app=app;
})(window, document, $);
